import React from 'react';
import logo from './img/logo-white-horizontal.png';
import iphone1 from './img/iphone-1.png';
import iphone2 from './img/iphone-2.png';
import iphone3 from './img/iphone-3.png';
import MyForm from './components/MyForm';

function App() {
  return (
    <div className="App">
      <img src={logo} alt="Hopo Logo" className="hopo-logo col-12 col-md-2" />
      <h2 className="col-12 col-md-6">Shopping at the airport? <span>We deliver it where you are!</span></h2>
      <div className="iphone-presentation mx-auto">
        <h3>DOWNLOAD</h3>
        <img src={iphone1} alt="iphone 1" className="iphone-1" />
      </div>
      <div className="iphone-presentation mx-auto">
        <h3>CHOOSE</h3>
        <img src={iphone2} alt="iphone 2" className="iphone-2" />
      </div>
      <div className="iphone-presentation mx-auto">
        <h3>ENJOY!</h3>
        <img src={iphone3} alt="iphone 3" className="iphone-3" />
      </div>
      <MyForm />
    </div>
  );
}

export default App;
